import React,{yseRef, useState} from "react";
import '../styles/tour-details.css'	
import { Container, Row, Col, Form, ListGroup } from "reactstrap"
import { useParams } from "react-router-dom" 	;
import tourData from "../assets/data/tours";
import calculateAvgRating from './../utils/avgRating';
import avatar from '../assets/images/avatar.jpg';
	import Booking from "../components/Booking/Booking";

const TourDetails = () => {
    
    const { id } = useParams();
    const reviewMsgRef = useRef('')
    const [tourRating,setTourRating]=useState(null)
    
    const tour = tourData.find(tour=> tour.id === id)
    
  
    const { photo , title, desc, price, address, reviews, city, distance, maxGroupSize } = tour;
   
    const {totalRating, avgRating} = calculateAvgRating (reviews)

    const options = {day: 'numeric',month: "long",year:"numeric"};

      return (
        <>
        <section>
            <Container>
                <Row>
                    <Col lg= "8">
                       <div className="tour__content">
                          <img src={photo} />
                        
                          <div className="tour__info">
                            <h2>{title}</h2>

                            <div className="d-flex align-items-center gap-5">
                                <span className="tour _rating d=flex align-items-center gap-1">
                                    <i class="ri-star-s-fill" style={{'color':"var(--secondary-color)"}}></i> 
                                    {calculateAvgRating === 0 ? null : avgRating}
                                    {totalRating == 0 ? (
                                        "Not rated" 
                                    ) : (
                                       <span> ({reviews.length}) </span>
                                    )}
                                    </span>
                                <span>
                                <i class="ri-map-pin-user-line"></i> {address}
                                </span>
                                 </div>
                                 <h5>Description</h5>
                                 <p>{decs}</p>
                          
                          <div className="tour__extra-details">
                            <span><i class="ri-map-pin-add-line"></i>{city}</span>
                            <span><i class="ri-money-dollar-circle-line"></i> ${price} / per person</span>
                            <span><i class="ri-group-line"></i>{maxGroupSize}
                            </span>
                            </div>
                            {/*==========tour reviews section========== */}
                            <div className="tour__review mt-4">
                                <h4>Reviews({reviews?.length} reviews)</h4>
                                <Form>
                                    <div className="d-flex align-items-center gap-3 mb-4 rating__group">
                                       1 <span>
                                        <i class="ri-star-s-fill"></i>
                                       </span>
                                       2 <span>
                                        <i class="ri-star-s-fill"></i>
                                        </span>
                                       3 <span>
                                        <i class="ri-star-s-fill"></i>
                                        </span>
                                       4 <span>
                                        <i class="ri-star-s-fill"></i>
                                        </span>
                                       5 <span>
                                        <i class="ri-star-s-fill"></i>
                                        </span>
                                    </div>
                                    
                                    <div
                                        className="review__input">
                                            <input type="text"placeholder="share your thoughts" />
                                            button.btn.primary__
                                    </div>
                                </Form>
                            </div>
                            </div>
                            
                            {/*==========tour reviews section ends ==========*/}
                        </div>
                        <Booking tour={tour} />
                    </Col>
                </Row>
            </Container>
         </section>
        </>

    );

};
    
export default TourDetails;
